'use strict'

import React from 'react';

export function CardPage(){
    const [inputValue, setInputValue] = useState('')//initialize as empty string

    //Declare project cards
    const quakeLabCard = (
        <div className="project_card"><a href="https://www.github.com/lswans" className="card_button"><h3>Denolle Quake Lab; Web Interface with Earthquake Database</h3>
                <p>Currently building an online interface with the UW Department of Earth and Space Science's seismic data server to allow public access to 50TB+ of earthquake measurements. Writing scripts and designing website to visualize said data in a useful manner.</p>
            </a>
        </div>
    )

    const clarityAPICard = (
        <div className="project_card"><a href="https://www.github.com/lswans" className="card_button"><h3>ClarityAPI: Air Quality Web App</h3>
            <p>An air quality visualisation app that provides health recommendations based on your area's air quality readings.</p></a>
        </div>
    )
    
    const vesperCard = (
        <div className="project_card"><a href="https://lucasjswanson.weebly.com/nasa-rasc-al.html" className="card_button"><h3>Project VESPER: NASA RASC-AL Proposal</h3>
            <p>A proposal detailing a manned flyby mission of Venus to collect evidence of liquid water's past or present existence on the surface.</p>
            </a>
        </div>
    )
    const lspaceCard = (
        <div class="project_card"><a href="https://lucasjswanson.weebly.com/project-glacier.html" class="card_button"><h3>Project GLACIER: NASA L'SPACE Mission Concept Academy Deliverable</h3>
            <p>Geological Lunar Analysis of Crater-Ice for the Extraciton of Resources (GLACIER). A PDR (Preliminary Design Review) submission detailing a combined satellite and lander mission to quantify ice volume in the polar regions of the Moon.</p></a>
        </div>
    )
    
    const spaceGrantCard = (
        <div className="project_card"><a href="https://lucasjswanson.weebly.com/space-grant-research.html" className="card_button"><h3>Washington NASA Space Grant; Quantifying Climate Change Trends</h3>
            <p>A research project querying and visualizing 15+ years of sea surface temperature data, collected by thermal imaging satellites owned and operated by NASA Goddard Space Flight Center. The project focused on the Kuroshio Current, specifically the section of water surrounding Green Island.</p></a>
        </div>
    )

    const fieldCampCard = (
        <div className="project_card"><a href="https://lucasjswanson.weebly.com/ess-401.html" className="card_button"><h3>ESS 401: Geology Field Camp w/ ArcGIS</h3>
            <p>A six-week full-time course focused on building relevant career skills for aspiring geologists. Conducted field geology experiments, collected data and created ArcGIS products.</p></a>
        </div>
    )

    let aqiCards = aqiData.map(place => {
        if (place.name.toLowerCase().includes(inputValue.toLowerCase())) {
            return (<Card key={place.name} place={place} />)
        }

    })
    return(
        <div className="project_cards">
            
            
            
            
            
            

        </div>
    )
}
